import { Link } from "react-router-dom";
import classese from "./BoardList.module.css";

function BoardList({ boards }) {
  // const events = useLoaderData();
  console.log(boards);

  return (
    <div>
      <h1>게시판</h1>
      <div>
        <table className={classese.styledtable}>
          <thead>
            <tr>
              <th>게시글번호</th>
              <th>제목</th>
              <th>작성자</th>
              <th>최종수정일</th>
            </tr>
          </thead>
          <tbody>
            {boards.map((board) => (
              <Link to={board.pnum}>
                <tr key={board.pnum}>
                  <td>{board.pnum}</td>
                  <td>{board.title}</td>
                  <td>{board.author}</td>
                  <td>{board.modifiedDate}</td>
                </tr>
              </Link>
            ))}
          </tbody>
        </table>
        <div>
          <div>
            <a href="/" role="button">
              글 등록
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default BoardList;
